import React from "react";

function star(value, req) {
  return (
    <span>
      <i
        class={
          value >= 5
            ? "fa-solid fa-star"
            : value >= 0.5
            ? "fa-regular fa-star"
            : "fa-regular fa-star-half-stroke"
        }
      ></i>
    </span>
  );
}

const Rating = ({ value, text }) => {
  return (
    <div className="rating">
      {star({ value }, 0)}
      <span> {text && text} </span>
    </div>
  );
};

export default Rating;
